import { Injectable } from '@angular/core';
import {
  HttpClient,
  HttpHeaders,
  HttpParams,
  HttpErrorResponse,
} from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class AuthService {

  public userData:any;

  token: string =
    'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFkbWluQGdtYWlsLmNvbSIsImFkbWluIjp0cnVlLCJpYXQiOjE2NzcxMzAzOTksImV4cCI6MTcwODIzNDM5OX0.b9UyeCZyMzw1tzsbKy0T8-l-NmbemJOL-mOLBGn2-Ck';
  bearerToken: string = 'bearer' + ' ' + this.token;

  headers: any = new HttpHeaders({
    'Content-Type': 'application/json; charset=utf-8',
    'Access-Control-Allow-Origin': '*',
    Authorization: this.bearerToken,
  });

  login: boolean = true;
  constructor(private http: HttpClient) {}

  url = 'http://localhost:5000/user/?email=admin@gmail.com';

  getUser() {
    this.http.get(this.url, this.headers).subscribe((data) => {
      return data;
    });
  }
}
